        <script>
        $(document).ready(function () {
            // modal
            $('#search_all_button')
                .click(function () {
                    $('#search_all_modal')
                        .modal({
                            centered: false
                        })
                        .modal('show');
                })
            ;

            // ajax search
            const AJAX_SEARCH_DELAY = 1300;

            function getSearchSettings(section) {
                let searchSettings = {
                    apiSettings: {
                        url: `/data/${section}/search?q={query}&t=1557777002`,
                    },
                    showNoResults: false,
                    error: {
                        noResults: ''
                    },
                    searchDelay: AJAX_SEARCH_DELAY,
                };
                return searchSettings;
            }

            $('.player_search_container')
                .search(getSearchSettings('player'))
            ;

            $('.clan_search_container')
                .search(getSearchSettings('clan'))
            ;

            // key input enter
            function gotoSearch(section, tag) {
                if (tag[0] === '#') {
                    tag = tag.substring(1)
                }
                window.location.href = `/${section}/${tag}`;
            }

            $('#search_all_modal input')
                .on('keyup', function (e) {
                    if (e.keyCode === 13) {
                        let tag = $(this).val();
                        let section = $(this).data('section');
                        gotoSearch(section, tag);
                    }
                })
            ;

        })
